import React, { useState } from 'react'
import logo from './logo.svg'
import './App.css'
import RepeatingDos from './RepeatingDos'
import LoadData from './LoadData'
import { DoData, ToDo } from './DoData'
import { setEnvironmentData } from 'worker_threads'
import useLocalStorageState from 'use-local-storage-state'


function App() {
  const [data, setData] = useState<ToDo[]>([])
  const [localStorage, setLocalStorage] = useLocalStorageState('donext', {
    defaultValue: data
  })


  const persistData = (data: ToDo[]) => {
    setData(data)
    setLocalStorage(data)
  }

  return (
    <div className="App">
      <RepeatingDos data={data} />
      <LoadData setData={setData} />
    </div>
  )
}

export default App
